import React from 'react';
import bnbLogo from '../bnb-logo.png';
const CardMeta = () => {
    return (
      <div className='card-content_meta'>
        <div className='card-content_meta-left'>

          <img src = {bnbLogo} width = '10' height = '10'/>

          <p>0.041ETH</p>
        </div>
        <div className='card-content_meta-right'>
          <svg
            className='card-content_meta-left-clock'
            viewBox='0 2 20 15'
            width='17'
            height='17'
          >
            <path
              d='M8.305 2.007a6.667 6.667 0 1 0 0 13.334 6.667 6.667 0 0 0 0-13.334Zm2.667 7.334H8.305a.667.667 0 0 1-.667-.667V6.007a.667.667 0 0 1 1.334 0v2h2a.667.667 0 0 1 0 1.334Z'
              fill='#8BACD9'
            />
          </svg>
          <p>3 days left</p>
        </div>
      </div>
    );
  };

  export default CardMeta;
